    //#region resizeWindow
         var hk_resizeWindowFn = new Array();
         var resizeWindow_callback = function (functions) {
             if (functions.length > 0) {
                 for (var i in functions) {
                     eval(functions[i])
                 }
             }
         };
         window.resizeWindow = function () {
             var b, c, a;
             if (typeof window.innerWidth != "undefined") {
                 b = window.innerWidth; c = window.innerHeight
             } else {
                 if (typeof document.documentElement != "undefined" && typeof document.documentElement.clientWidth != "undefined" && document.documentElement.clientWidth != 0) {
                     b = document.documentElement.clientWidth, c = document.documentElement.clientHeight
                 } else {
                     b = document.getElementsByTagName("body")[0].clientWidth, c = document.getElementsByTagName("body")[0].clientHeight
                 }
             }
             if (hk.window.innerWidth == 0) { hk.window.innerWidth = b }
             
             if (hk.window.innerWidth <= b) {
                 a = "xl"; if (b < 1200){ a = "lg" } if (b < 992){ a = "md" } if (b < 768){ a = "sm" } if (b < 576){ a = "xs" } 
             } else {
                 if (b > 0){ a = "xs" } if (b >= 576){ a = "sm" } if (b >= 768){ a = "md" } if (b >= 992){ a = "lg" } if (b >= 1200) { a = "xl" }
             }
             
             hk.window.innerWidth = b; hk.window.innerHeight = c;
             if (hk.screen.type != a) {
             }
             hk.screen.type = a;
             var $Html = jQuery(html);
             $Html.removeClass('screen-xs').removeClass('screen-sm').removeClass('screen-md').removeClass('screen-lg').removeClass('screen-xl');
             $Html.addClass('screen-'+hk.screen.type);
             resizeWindow_callback(hk_resizeWindowFn);
         };
    //#endregion

    //#region ScrollWindow
    var hk_scrollWindowFn = new Array();
    var scrollWindow_callback = function (functions) {
        if (functions.length > 0) {
            for (var i in functions) {
                eval(functions[i])
            }
        }
    };
    window.scrollWindow = function () {
        hk.window.scrollTop = $(window).scrollTop();
        scrollWindow_callback(hk_scrollWindowFn);
    };
    //#endregion ScrollWindow

    //#region Browser's
    var hk_browsers = function(){
        var is_chrome = navigator.userAgent.indexOf('Chrome') > -1;
        var is_explorer = navigator.userAgent.indexOf('MSIE') > -1;
        var is_firefox = navigator.userAgent.indexOf('Firefox') > -1;
        var is_safari = navigator.userAgent.indexOf("Safari") > -1;
        var is_opera = navigator.userAgent.indexOf("Presto") > -1;
        if ((is_chrome)&&(is_safari)) {is_safari=false;}
        
        if( is_safari ){
            $('body').addClass('safari');
        }
        else if( is_explorer ){
            $('body').addClass('ie');
        }
        else if( is_firefox ){
            $('body').addClass('firefox');
        }
        else if( is_opera ){
            $('body').addClass('opera');
        }
        else {
            $('body').addClass('chrome');
        }
    };
    //#endregion Browser's

    //region frm_basic
    const hk_frm_basic = function (formID) {
        const form_tagID = formID;
        const form_submit = "#hk-btn-submit";
        const form_action = $(form_tagID).attr('data-action');
        const form = $(form_tagID);
        const message = $('.msg', form_tagID);
        const msg = {
            'MF000': 'Enviado con éxito!',
            'MF001': 'Los destinatarios no están configurados',
            'MF002': 'El formulario no funcionará localmente',
            'MF004': 'Por favor, defina el tipo de su formulario',
            'MF254': '¡Algo salió mal con PHPMailer!',
            'MF255': 'Aw, snap! Algo salió mal.',
            'MV001': 'Por favor, defina Nombre',
            'MV002': 'Por favor, defina Email',
            'MV004': 'Por favor, defina Uso de Datos',
            'MV005': 'Error, fromTo sin definir',
            'MV006': 'Por favor, defina Telefono',
            'MV007': 'Por favor, defina Mensaje',
            'MV008': 'Por favor, defina Stand',
            'MV009': 'Por favor, defina Isla',
        };
    
        //region Hover effect
        const frm = $(formID);
        let frmFocus = false;
        let frmOver = false;
        $(".frm-event", frm).focus(function () {
            if (frmFocus == false) {
                frm.addClass('frm-focus');
                frm.find('.parsley-errors-list').show();
                frmFocus = true;
            }
        });
        $(frm).mouseenter(function () {
            frmOver = true;
        });
        //endregion
    
        //region validate parsley
        const floatingLabel = function (onload) { //console.log(onload);
            if (onload) {
                $.each($('input', '.bt-flabels__wrapper'), function (index, value) {
                    const $current_input = $(value);
                    if ($current_input.val()) {
                        $current_input.closest('.bt-flabels__wrapper').addClass('bt-flabel__float');
                    }
                });
            }
        };
    
        const floatingLabelActions = function () {
            const $input = $(this);
            setTimeout((function () {
                if ($input.val()) {
                    $input.closest('.bt-flabels__wrapper').addClass('bt-flabel__float');
                } else {
                    $input.closest('.bt-flabels__wrapper').removeClass('bt-flabel__float');
                }
            }), 1);
        }
    
        $('.bt-flabels__wrapper input').keydown(floatingLabelActions);
        $('.bt-flabels__wrapper input').change(floatingLabelActions);
    
        $('.bt-flabels__wrapper textarea').keydown(floatingLabelActions);
        $('.bt-flabels__wrapper textarea').change(floatingLabelActions);
    
        window.addEventListener('load', floatingLabel(true), false);

        const jsParsley = form.parsley();
        form.parsley().on('form:error', function () {
            $.each(this.fields, function (key, field) {
                if (field.validationResult !== true) {
                    field.$element.closest('.bt-flabels__wrapper').addClass('bt-flabels__error');
                }
            });
        });
    
        form.parsley().on('field:validated', function () {
            if (this.validationResult === true) {
                this.$element.closest('.bt-flabels__wrapper').removeClass('bt-flabels__error');
            } else {
                this.$element.closest('.bt-flabels__wrapper').addClass('bt-flabels__error');
            }
        });
    
        $(form_submit).click(function (e) {
            e.preventDefault();
    
            var _this = $(this);
    
            form.parsley().validate();

            if (form.parsley().isValid()) {
    
                _this.addClass('sending');
                _this.attr('disabled', 'disabled');
                
                var xhr = $.ajax({
                    type: "POST",
                    url: form_action,
                    data: form.serialize(),
                });
    
                return xhr.then(function (json) {
                    _.delay(function () {

                        _this.removeClass('sending');
    
                        if (json == 'MF000') {
                            disableForm();
                            message.text(msg[json]);
                            _this.addClass('success'); 
                            _.delay(function () {
                                resetForm();
                                _this.removeAttr('disabled');
                                _this.removeClass('success');
                                message.text('');
                                //location.reload();
                            }, 3000);
                        } else {
                            message.text(msg[json]);
                            _this.addClass('fail');
                            _.delay(function () {
                                _this.removeAttr('disabled');
                                _this.removeClass('fail');
                                message.text('');
                            }, 3000);
                        }
    
                    }, 1000);
                });
            }
            return false;
        });
    
        const disableForm = function () {
            $('input', form).attr('disabled', 'disabled')
        };
        const resetForm = function () {
            form.parsley().reset();
            $('.js-interesLevel').val('').trigger('change')
            $('input.checkbox-input', form).prop("checked", false);
            $('input', form).val('').removeAttr('disabled');
            $('textarea', form).val('').removeAttr('disabled');
            $('.bt-flabel__float', form).removeClass('bt-flabel__float');
        };
        //endregion validate parsley
    };
    //endregion frm_basic

    //#region => Instant Chat
    var instantChat = function(){
        var ele = $('#instant-chat');
        var offset = ele.offset();
        var eleHeight = 64;
        var eleFoot = $('.footer');
        var offsetFoot = eleFoot.offset();
        var footPosY = offsetFoot.top - (eleFoot.outerHeight()*2) - ( eleHeight );

        var yposTop = hk.window.innerHeight;
        var yposBottom = offsetFoot.top;
        var limitTop = 300 - eleHeight; //(offset.top - 780);

        //console.log("instantChat: "+ hk.window.scrollTop  + " > " +  limitTop + " height:" + eleHeight );
        if(  hk.window.scrollTop < limitTop ){
            ele.css({'top': (hk.window.innerHeight-42) +'px', 'bottom': 'auto', 'position' : 'fixed' });
        }

        if( hk.window.scrollTop > limitTop ){
            ele.css({'top':'auto', 'bottom': '42px', 'position' : 'fixed' });
        }

        if(  hk.window.scrollTop > footPosY ){
            ele.css({'top': yposBottom, 'bottom':'auto', 'position' : 'absolute' });
        }

    };
    //#endregion Instant Chat

