//#region PROYECT
    var hk_Navbar_active = function($xAnclaNow){
        window.location.hash = '#!'+$xAnclaNow;
        $('[hk-ancla-from="'+$.xAnclaAct+'"]').removeClass("active");
        $('[hk-ancla-from="'+$xAnclaNow+'"]').addClass("active");
        $.xAnclaAct = $xAnclaNow;
    }
    var hk_navbar_scroll = function(){
        var $xAnclaNow = "";
        //console.log( $.xAnclasTo.length );
        $.xAnclasTo.each( function(i,e){
            var $xPosY = ($(this).position()).top;
            var $xLast = $.xAnclasTo.length-1;
            var $xPosYend = $xPosY - $.Header.height() - 6;
            if( hk.window.scrollTop > $xPosYend ){
                $xAnclaNow = $(this).attr("hk-ancla-to") ? $(this).attr("hk-ancla-to") : "";
            }
        });
        if($xAnclaNow != $.xAnclaAct){
            hk_Navbar_active($xAnclaNow);
        }
    }
    var hk_page_home = function(){
        if ($(".owl-howWorks").length > 0 ){
            var owl = $('.owl-howWorks');
            owl.owlCarousel({
                dots: false,
                nav: true,
                freeDrag: false,
                lazyLoad: true,
                margin: 20,
                startPosition: 0,
                autoplay: false,
                autoplayHoverPause: false,
                responsive: {
                    0: {
                        autoplay: false,
                        loop: true,
                        items: 1,
                    }
                }
            });
        };
        var sticky = new Sticky('.sticky-js');

        if ( $("#contact-form").length == 1 ) {
            hk_frm_basic("#contact-form");
        };

        if($.xAnclasFrom.length>0){
            $.xAnclasFrom.each( function( index, element ){
                // OnClic
                $(this).click( function(e){ e.preventDefault();
                    var targetOffset = 0;
                    var distance = 0;
                    var animationTime = 0;
                    var $attr = $(this).attr("hk-ancla-from");
                    var $target = $('[hk-ancla-to="'+$attr+'"]');
                    // Establecer un tiempo mínimo y máximo para la animación
                    var minTime = 0; // Tiempo mínimo en milisegundos
                    var maxTime = 500; // Tiempo máximo en milisegundos
                    if($target.length>0){
                        targetOffset = ($attr !== 'inicio') ? ($($target).offset().top - $.Header.height()) : 0;
                        distance = Math.abs(targetOffset - $(window).scrollTop());
                        animationTime = Math.max(minTime, Math.min(maxTime, distance));
                        $('html,body').animate({scrollTop: targetOffset}, animationTime, "linear");
                        hk_Navbar_active($attr);
                    }
                });
            });
        };
    };

//#endregion PROYECT


